import React from "react";
import "./TripStyles.css";
import TripData from "./TripData";

const Trip = () => {
  return (
    <>
      <div className="trip">
        <h1> Recent Trips</h1>
        <p> You can discover unique destinations using Google maps. </p>
        <div className="tripcard">
          <TripData />
        </div>
      </div>
      <h2> Trip data</h2>
    </>
  );
};

export default Trip;
